field_event_description:
  -
    value: "<p>Our great Local Representatives Yassin and Roman are inviting you to an EIT Digital Alumni meetup \"On Ice\" ;)</p>\r\n\r\n<p>This will happen on Tuesday, December 13th, at 18:00 at the ice skating ring in Vasaparken (close to St.Eriksplan T-Bana).</p>\r\n\r\n<p>Please note that you cannot rent skates there!</p>\r\n\r\n<p>Afterwards, at around 20:00, the group will move to a close-by bar for some hot tea and drinks. Feel like joining?</p>\r\n\r\n<p>Press on \"Going\" on <a href=\"https://www.facebook.com/events/1341744982511789/\">our Facebook event</a> and share it with your EIT friends ;)</p>\r\n"
